    public static String getGenomeFromFasta(String path) throws IOException {
        File file = new File(path);

        BufferedReader br = new BufferedReader(new FileReader(file));

        String genome = "";
        String metaData = br.readLine();
        String st;
        while ((st = br.readLine()) != null)
            genome = genome.concat(st);
        return genome;
    }

    public static void printMatchingPercent(String sequence1, String sequence2) {
        double matchesCount = 0;
        for (int i = 0; i < sequence1.length(); i++) {
            if (sequence1.charAt(i) == sequence2.charAt(i)) {
                matchesCount++;
            }
        }

        double percent = (matchesCount / sequence1.length()) * 100;

        System.out.println(String.format("%.2f %%", percent));
    }

